import React from "react";

const Hello = () => {
    const name = "Chi";
    return(
    <div className="jumbtron">
        <div className="row">
            <div className="col-12">
                <h1>Title of Page</h1>
                <h2>This page is a test</h2>
                <ul>
                    <li>Food</li>
                    <li>Sports</li>
                </ul>
            </div>
        </div>
    </div>
    );
};
   
export default Hello;
